DROP database IF EXISTS goods_delivery;

CREATE database goods_delivery;

use goods_delivery;
# TABLE STRUCTURE FOR: city
#

DROP TABLE IF EXISTS `city`;

CREATE TABLE `city` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Номер города',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название города',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Города';



#
# TABLE STRUCTURE FOR: country
#

DROP TABLE IF EXISTS `country`;

CREATE TABLE `country` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Номер страны',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название страны',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Страны';


DROP TABLE IF EXISTS `tariffs`;

CREATE TABLE `tariffs` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Номер тарифа',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название тарифа',
  `description` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание тарифа',
  `base_price` decimal(10,0) NOT NULL COMMENT 'Начальная цена тарифа',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Тарифы';



#
# TABLE STRUCTURE FOR: vehicle
#

DROP TABLE IF EXISTS `vehicle`;

CREATE TABLE `vehicle` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `model` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Модель ТС',
  `brand` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Марка ТС',
  `year_of_production` year(4) DEFAULT NULL COMMENT 'Год выпуска ТС',
  `vehicle_number` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Номер ТС',
  `vehicle_type` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тип ТС',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Транспортные средства';

#
# TABLE STRUCTURE FOR: couriers
#

DROP TABLE IF EXISTS `couriers`;

CREATE TABLE `couriers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя курьера',
  `last_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия курьера',
  `birthday_at` date NOT NULL COMMENT 'Дата рождения',
  `phone_number` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Курьеры';



#
# TABLE STRUCTURE FOR: customers
#

DROP TABLE IF EXISTS `customers`;

CREATE TABLE `customers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя клиента',
  `last_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия клиента',
  `phone_number` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `country_id` int(11) NOT NULL COMMENT 'Страна нахождения клиента',
  `city_id` int(11) NOT NULL COMMENT 'Город нахождения клиента',
  `district` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Район',
  `street` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Улица проживания',
  `house` int(11) NOT NULL COMMENT 'Номер дома',
  `apartment` int(11) NOT NULL COMMENT 'Номер квартиры',
  PRIMARY KEY (`id`),
  KEY `customers_country_id_fk` (`country_id`),
  KEY `customers_city_id_fk` (`city_id`),
  CONSTRAINT `customers_city_id_fk` FOREIGN KEY (`city_id`) REFERENCES `city` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `customers_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `country` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: delivery_status
#

DROP TABLE IF EXISTS `delivery_status`;

CREATE TABLE `delivery_status` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Номер заказа',
  `name` varchar(35) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Статус заказа',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

#
# TABLE STRUCTURE FOR: delivery
#

DROP TABLE IF EXISTS `delivery`;

CREATE TABLE `delivery` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Номер заказа',
  `track_number` int(11) NOT NULL COMMENT 'Номер для отслеживания заказа, сложная комбинация цифр',
  `customer_id` int(11) NOT NULL COMMENT 'Номер клиента, сделавшего заказ',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания заказа',
  `completion_date` datetime DEFAULT NULL COMMENT 'Время завершения заказа',
  `departure_country_id` int(11) NOT NULL COMMENT 'Страна отправления',
  `departure_city_id` int(11) NOT NULL COMMENT 'Город отправления',
  `departure_address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес отправления',
  `destination_country_id` int(11) NOT NULL COMMENT 'Страна назначения',
  `destination_city_id` int(11) NOT NULL COMMENT 'Город назначения',
  `delivery_address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес назначения',
  `delivery_status_id` int(11) NOT NULL COMMENT 'Статус заказа',
  `final_price` decimal(10,0) DEFAULT NULL COMMENT 'Окончательная цена',
  PRIMARY KEY (`id`),
  UNIQUE KEY `track_number` (`track_number`),
  KEY `delivery_customer_id_fk` (`customer_id`),
  KEY `delivery_depart_country_id_fk` (`departure_country_id`),
  KEY `delivery_departure_city_id_fk` (`departure_city_id`),
  KEY `delivery_destination_country_id_fk` (`destination_country_id`),
  KEY `delivery_destination_city_id_fk` (`destination_city_id`),
  KEY `delivery_status_id_fk` (`delivery_status_id`),
  CONSTRAINT `delivery_customer_id_fk` FOREIGN KEY (`customer_id`) REFERENCES `customers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `delivery_depart_country_id_fk` FOREIGN KEY (`departure_country_id`) REFERENCES `country` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `delivery_departure_city_id_fk` FOREIGN KEY (`departure_city_id`) REFERENCES `city` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `delivery_destination_city_id_fk` FOREIGN KEY (`destination_city_id`) REFERENCES `city` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `delivery_destination_country_id_fk` FOREIGN KEY (`destination_country_id`) REFERENCES `country` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `delivery_status_id_fk` FOREIGN KEY (`delivery_status_id`) REFERENCES `delivery_status` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Информация о доставляемом заказе';



#
# TABLE STRUCTURE FOR: delivery_info
#

DROP TABLE IF EXISTS `delivery_info`;

CREATE TABLE `delivery_info` (
  `delivery_id` int(11) NOT NULL,
  `weight` int(10) unsigned NOT NULL COMMENT 'Вес товара',
  `volume` int(10) unsigned NOT NULL COMMENT 'Объем товара',
  `max_size` int(10) unsigned NOT NULL COMMENT 'Максимальный габарит груза - max ширина, max длина или max глубина',
  `characteristic` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Особые характеристики груза: хрупкий, жидкий...',
  `packaging` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Упаковка груза',
  `tariff_id` int(11) NOT NULL COMMENT 'Тариф расчета стоимости доставки',
  KEY `delivery_info_delivery_id_fk` (`delivery_id`),
  CONSTRAINT `delivery_info_delivery_id_fk` FOREIGN KEY (`delivery_id`) REFERENCES `delivery` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  KEY `delivery_info_tariff_id_fk` (`tariff_id`),
  CONSTRAINT `delivery_info_tariff_id_fk` FOREIGN KEY (`tariff_id`) REFERENCES `tariffs` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Характеристики доставляемого заказа';



#
# TABLE STRUCTURE FOR: gts
#

DROP TABLE IF EXISTS `gts`;

CREATE TABLE `gts` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Идентификационный номер организации-перевозчика',
  `company_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название организации-перевозчика',
  `country_id` int(11) NOT NULL COMMENT 'Страна нахождения организации-перевозчика',
  `city_id` int(11) NOT NULL COMMENT 'Город нахождения организации-перевозчика',
  `business_address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Юридический адрес организации-перевозчика',
  `phone_number` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон организации-перевозчика',
  `current_account` int(11) NOT NULL COMMENT 'Расчетный счет организации-перевозчика',
  PRIMARY KEY (`id`),
  KEY `gts_country_id_fk` (`country_id`),
  KEY `gts_city_id_fk` (`city_id`),
  CONSTRAINT `gts_city_id_fk` FOREIGN KEY (`city_id`) REFERENCES `city` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `gts_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `country` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Сервис по доставке международных грузов';

#
# TABLE STRUCTURE FOR: global_tracking
#

DROP TABLE IF EXISTS `global_tracking`;

CREATE TABLE `global_tracking` (
  `track_number` int(11) NOT NULL COMMENT 'Сложный номер для отслеживания заказа',
  `gts_id` int(11) NOT NULL COMMENT 'Идентификационный номер организации-перевозчика',
  `destination_point` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пункт назначения',
  `track_time` datetime NOT NULL COMMENT 'Время события',
  `track_status` enum('arrived','left') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  UNIQUE KEY `track_number` (`track_number`),
  KEY `global_tracking_gts_id_fk` (`gts_id`),
  CONSTRAINT `global_tracking_gts_id_fk` FOREIGN KEY (`gts_id`) REFERENCES `gts` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `global_tracking_track_num_fk` FOREIGN KEY (`track_number`) REFERENCES `delivery` (`track_number`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Отслеживание местонахождения международного заказа';



#
# TABLE STRUCTURE FOR: local_tracking
#

DROP TABLE IF EXISTS `local_tracking`;

CREATE TABLE `local_tracking` (
  `track_number` int(11) NOT NULL COMMENT 'Сложный номер для отслеживания заказа',
  `courier_id` int(11) NOT NULL,
  `destination_point` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пункт доставки',
  `vehicle_id` int(11) NOT NULL COMMENT 'Тип ТС',
  UNIQUE KEY `track_number` (`track_number`),
  KEY `local_tracking_courier_id_fk` (`courier_id`),
  KEY `local_tracking_vehicle_id_fk` (`vehicle_id`),
  CONSTRAINT `local_tracking_courier_id_fk` FOREIGN KEY (`courier_id`) REFERENCES `couriers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `local_tracking_track_num_fk` FOREIGN KEY (`track_number`) REFERENCES `delivery` (`track_number`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `local_tracking_vehicle_id_fk` FOREIGN KEY (`vehicle_id`) REFERENCES `vehicle` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Отслеживание местонахождения заказа по России';



